import React from 'react'

function PricingCard(props) {
  return (
    <>
        {
            props.items.map(
            card => (
                <div className='col-12 col-md-3'>
                <div className="card text-white" id='dancetour-card'>
                    <img src={card.img} className="card-img-top" id='pricing-card-img' alt="..." />
                    <div className="card-body text-center bg-dark" id='pricing-card-bottom'>
                        <h5 className="card-title text-uppercase">{card.title}</h5>
                        <p className="card-text">{card.text}</p>
                    </div>
                    <div>
                        {card.price}
                    </div>
                </div>
                </div>
            )
            )
        }
    </>
  )
}

export default PricingCard
